def count_find_num(primesL, limit):
    base = eval('*'.join(map(str, primesL)))
    if base >= limit:
        return []
    results = [base]
    for p in primesL:
        for num in results[:]:
            current = num * p
            while current <= limit:
                if current not in results:
                    results.append(current)
                current *= p
    return [len(results), max(results)]

